import './App.css';
import Navbar from './component/Navbar';
import Home from './component/Home';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
        <Home/>
        <Navbar />
        <Routes>
          <Route path='/' element={<Home/>}></Route>
        </Routes>

    </div>
  );
}

export default App;
